import React from 'react';

function WaitingLobby({ onStartGame }) {
  return (
    <div className="waiting-lobby">
      <h2>Waiting Lobby</h2>
      <p>Waiting for other players...</p>
      <button onClick={onStartGame}>Start Game</button>
    </div>
  );
}

export default WaitingLobby;
